import React from 'react';
import ReactDOM from 'react-dom';
import faker from 'faker';
import CommentDetail from './CommentDetail';

const App = () => {
	return (
		<div className="ui container comments">
			<CommentDetail author="Sam" timeAgo="Today at 4:45PM" userComment="Nice blog post!" />
			<CommentDetail author="Alex" timeAgo="Today at 2:00AM" userComment="Cool post." />
			<CommentDetail author="Jane" timeAgo="Yesterday at 5:00PM" userComment="Interesting read." />
		</div>
	);
};

ReactDOM.render(<App />, document.querySelector('#root'));
